    // Wait for 'polymer-ready'. Ensures the element is upgraded.
    window.addEventListener('polymer-ready', function(e) {
      var world = document.querySelector('world-data');
      var ok = 0;
      var ko = 0;
      world.world.continents.forEach(function(continent){
        continent.countries.forEach(function(country){
            c = isodata.Results[country.code];
            country.names = c.Names;
            country.name = c.Name;
            country.codes = c.CountryCodes;
            country.capital = c.Capital;
            if (country.capital){
                delete country.capital.DLST;
                delete country.capital.Flg;
                delete country.capital.TD;
            }
            country.centroid = c.GeoPt;
            country.geoRectangle = c.GeoRectangle;
        });
      });
      console.log(world.world);
      console.log(JSON.stringify(world.world));
      document.querySelector('#json').innerHTML = '<pre>' + JSON.stringify(world.world) + '</pre>';
      
    });

  </script>
